import React, {Component} from 'react';
// import logo from './logo.svg';
import './App.css';

class App extends Component {
  render(){
    return (
      <div className="App">
        <Navigation/>
        <Logo/>
        <Rank/>
        <ImageLinkForm/>
        <FaceRecognition/>
      </div>
    );
  }
}

export default App;
